import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import { Typography, Switch, FormControlLabel, Dialog, DialogActions, DialogContent, DialogTitle } from '@mui/material';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';
import { useNavigate } from 'react-router-dom'; // Import useNavigate

function ManageExamSP() {
    const [open1, setOpen1] = useState(false);
    const [open2, setOpen2] = useState(false);
    const [open3, setOpen3] = useState(false);
    const [dialogOpen, setDialogOpen] = useState(false);
    const [dialogMessage, setDialogMessage] = useState('');

    const navigate = useNavigate(); // Initialize useNavigate

    const handleConfirm = () => {
        let message = "";

        if (open1) {
            message += "เปิดการสอบหัวข้อ\n";
        } else {
            message += "ปิดการสอบหัวข้อปิด\n";
        }

        if (open2) {
            message += "การสอบก้าวหน้า is OPEN.\n";
        } else {
            message += "การสอบก้าวหน้า is CLOSED.\n";
        }

        if (open3) {
            message += "การสอบป้องกัน is OPEN.\n";
        } else {
            message += "การสอบป้องกัน is CLOSED.\n";
        }

        if (!message) {
            message = "No exams selected.";
        }

        setDialogMessage(message);
        setDialogOpen(true);
    };

    const handleCloseDialog = () => {
        setDialogOpen(false);
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <Box sx={{ marginLeft: 40 }}>
                                <Typography sx={{ marginLeft: 30 }}>
                                    <h1>จัดการการยื่นสอบ</h1>
                                </Typography>

                                <Box sx={{ marginTop: 2 }}>
                                    <FormControlLabel
                                        control={<Switch checked={open1} onChange={() => setOpen1(!open1)} />}
                                        label=" การสอบหัวข้อ"
                                    />
                                </Box>

                                <Box sx={{ marginTop: 2 }}>
                                    <FormControlLabel
                                        control={<Switch checked={open2} onChange={() => setOpen2(!open2)} />}
                                        label=" การสอบก้าวหน้า"
                                    />
                                </Box>

                                <Box sx={{ marginTop: 2 }}>
                                    <FormControlLabel
                                        control={<Switch checked={open3} onChange={() => setOpen3(!open3)} />}
                                        label=" การสอบป้องกัน"
                                    />
                                </Box>

                                <Box>
                                    <Button sx={{ marginTop: 5, marginLeft: 30, marginRight: 10 }} variant="contained" onClick={handleConfirm}>
                                        Confirm
                                    </Button>
                                </Box>

                                <Dialog
                                    open={dialogOpen}
                                    onClose={handleCloseDialog}
                                    aria-labelledby="alert-dialog-title"
                                    aria-describedby="alert-dialog-description"
                                >
                                    <DialogTitle id="alert-dialog-title">Exam Status Notification</DialogTitle>
                                    <DialogContent>
                                        <Typography id="alert-dialog-description">
                                            {dialogMessage}
                                        </Typography>
                                    </DialogContent>
                                    <DialogActions>
                                        <Button onClick={handleCloseDialog} color="primary">
                                            Close
                                        </Button>
                                    </DialogActions>
                                </Dialog>
                            </Box>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
}

export default ManageExamSP;
